import React, { useState } from 'react';
import '../App.css';
import logo from "../img/logo.png"

function Formulario(){

    const [formData, setFormData] = useState({
        ano: '2001', // Define um valor padrão para o ano
        percent: '90', // Define um valor padrão para o percentual
        partido: 'Digite...' // Define um valor padrão para os partidos
    });
    
    const handleInputChange = (event) => {
        const { name, value } = event.target;
        setFormData((prevData) => ({
          ...prevData,
          [name]: value,
        }));
    };

    const handleSubmit = (event) => {
        event.preventDefault();
        
        axios.post('http://127.0.0.1:5000/api/sendDados', formData)
          .then(response => {
            console.log('Resposta do servidor:', response.data);
          })
          .catch(error => {
            console.error('Erro ao enviar dados:', error);
          });
      };
    

    return (
        <form onSubmit={handleSubmit}>
            <div className='form'>
                <img src={logo} className='logo'/>
                <label>
                    Login:
                    <input name="myInput" className='dadosLogin' defaultValue="1000" />
                </label>
                <label>
                    Senha:
                    <input name="mySenha" className='dadosLogin' defaultValue="147258" />
                </label>
                <button type="submit"> Login </button>
            </div>
        </form>
  );
}

export default Formulario;
